This method and one you commented above are from two different classes. So do you want me to make this method public and use it in another class?', 'comment_created': datetime.datetime(2020, 7, 22, 11, 16, 55, tzinfo=datetime.timezone.utc), 'commenter': 'codeknight3', 'type': 'User'}, {'comment_id': 458719821, 'comment_body': 'Done.', 'comment_created': datetime.datetime(2020, 7, 22, 11, 20, 38, tzinfo=datetime.timezone.utc), 'commenter': 'codeknight3', 'type': 'User'}, {'comment_id': 459829744, 'comment_body': 'Done.', 'comment_created': datetime.datetime(2020, 7, 24, 2, 55, 47, tzinfo=datetime.timezone.utc), 'commenter': 'codeknight3', 'type': 'User'}, {'comment_id': 475246427, 'comment_body': 'This handling needs to be done whenever this list is updated not just at the time of onCreate. And there are still some places where it will not work. This thing should only handle the logic of creating the adapter of notification list, nothing else. Rest part like changing textview visibility or text should be done separately. You can create separate method which would basically handle the post list creation part.

```
private void changeUIVisibilityWhenAdapterUpdates() {
    if(notificationArrayList == null || notificationArrayList.size()==0) {
            textView.setText(R.string.No_data);
            textView.setVisibility(View.VISIBLE);
     } else {
            textView.setVisibility(View.GONE);
     }
}
```

And addnotification method should like below

```
private void addNotification() {
        notificationArrayList = dbHandler.getAllNotificationsWithResponses();
        notificationAdapter = new NotificationAdapter(notificationArrayList, this);
        TextView textView = findViewById(R.id.no_data_text_view);
         notificationAdapter.setonButtonClickListener(new NotificationAdapter.onButtonClickListener() {
                @Override
                public boolean onSendResponseButtonClick(int position, String response) {
                    Notification notification = notificationArrayList.get(position);
                    ResponseHandler responseHandler = new ResponseHandler(getApplicationContext());
                    boolean isDone = responseHandler.saveResponse(notification.getId(), response, new Date().getTime());
                    if (isDone) {
                        Toast.makeText(getApplicationContext(), "Message sent successfully", Toast.LENGTH_LONG).show();
                        return true;
                    } else {
                        Toast.makeText(getApplicationContext(), "Some error occurred. Please try again later", Toast.LENGTH_LONG).show();
                        return false;
                    }
                }
            });
}
```

And assign the `textView` and `recyclerView` in onCreate itself. Try to avoid assigning the UI elements in methods because when more and more people start contributing methods evolve and context of them changes with more and more features, so assignment should ideally be handled by the method caller.', 'comment_created': datetime.datetime(2020, 8, 23, 17, 48, 29, tzinfo=datetime.timezone.utc), 'commenter': 'lakshyagupta21', 'type': 'User'}, {'comment_id': 475246896, 'comment_body': '`When ServerDatabaseCommunicator.getInstance().getNotifications()` is called it changes the reference of `notificationArrayList` which is going to be different from the one you passed in `NotificationAdapter` so when you call `notificationAdapter.notifyDataSetChanged()` the adapter or the list is not going to be updated as it still have the old reference.

So to solve this problem you can do one thing. 
Step 1. Call `notificationArrayList.clear()` it will basically clear all your previous notification and avoid duplication of notification because `getNotifications()` will anyways fetch all of them again.
Step 2. `notificationArrayList.addAll(ServerDatabaseCommunicator.getInstance().getNotifications())`
This will bring all the notification from the database and add that to the same list that you passed to a `NotificationAdapter`', 'comment_created': datetime.datetime(2020, 8, 23, 17, 53, 8, tzinfo=datetime.timezone.utc), 'commenter': 'lakshyagupta21', 'type': 'User'}, {'comment_id': 475247008, 'comment_body': 'The public methods also needs to be made synchronized', 'comment_created': datetime.datetime(2020, 8, 23, 17, 54, 18, tzinfo=datetime.timezone.utc), 'commenter': 'lakshyagupta21', 'type': 'User'}, {'comment_id': 475247067, 'comment_body': 'Got it, Thanks', 'comment_created': datetime.datetime(2020, 8, 23, 17, 54, 46, tzinfo=datetime.timezone.utc), 'commenter': 'lakshyagupta21', 'type': 'User'}, {'comment_id': 476165770, 'comment_body': 'Done.', 'comment_created': datetime.datetime(2020, 8, 25, 4, 41, 18, tzinfo=datetime.timezone.utc), 'commenter': 'codeknight3', 'type': 'User'}, {'comment_id': 476167241, 'comment_body': 'Done. Thanks a lot for pointing out this error. Completely missed this one.', 'comment_created': datetime.datetime(2020, 8, 25, 4, 43, 19, tzinfo=datetime.timezone.utc), 'commenter': 'codeknight3', 'type': 'User'}, {'comment_id': 476167461, 'comment_body': 'Done.', 'comment_created': datetime.datetime(2020, 8, 25, 4, 43, 40, tzinfo=datetime.timezone.utc), 'commenter': 'codeknight3', 'type': 'User'}]
